import React from 'react';
import { useLoader } from '@react-three/fiber';
import { TextureLoader } from 'three';

const Panel = () => {
  const [albedo, roughness, normal] = useLoader(TextureLoader, [
    '/textures/leather/brown_leather_albedo_4k.jpg',
    '/textures/leather/brown_leather_rough_4k.jpg',
    '/textures/leather/brown_leather_nor_gl_4k.jpg',
  ]);
  return (
    <group>
      {/* Base panel box */}
      <mesh position={[0, -1, -7]}>
        <boxGeometry args={[36, 23, 0.5]} />
        <meshStandardMaterial color="#333" />
      </mesh>
    </group>
  );
};

export default Panel;
